const BOOKMARKTRUE = "bookmark/BOOKMARKTRUE";
const BOOKMARKFALSE = "bookmark/BOOKMARKFALSE";

export const bookmarkTrue = (id) => ({
  type: BOOKMARKTRUE,
  id: id,
});

export const bookmarkFalse = (id) => ({
  type: BOOKMARKTRUE,
  id: id,
});

const intialID = {};
